'use strict';
let MessageType = require('./MessageType.js');
//@@DocBrief("The interface for getting response on 'get sso token' message")
class GetSsoTokenMessage {
    token;
    error;
    requestNumber;
    constructor() {
        this.token = "";
        this.requestNumber = -1;
    }
    getError() {
        return this.error;
    }
    getRequestNumber() {
        return this.requestNumber;
    }
    getToken() {
        return this.token;
    }
    getType() {
        return MessageType.GetSsoToken;
    }
}
module.exports = GetSsoTokenMessage
